    "2014-10-28T20:54:58.836630",nt"name": "seafloor-character-offshore-of-san-gregorio-california",nt"isopen":
    false,nt"url": null,nt"notes": "This part of SIM 3306 presents data for
    the seafloor-character map (see sheet 5, SIM 3306) of the Offshore of San Gregorio
    map area, California. The raster data file is included in "SeafloorCharacter_OffshoreSanGregorio.zip,"
    which is accessible from http://pubs.usgs.gov/ds/781/OffshoreSanGregorio/data_catalog_OffshoreSanGregorio.html.
    This raster-format seafloor-character map shows four substrate classes in the Offshore
    of San Gregorio map area. The substrate classes mapped in this area have been colored
    to indicate which of the following California Marine Life Protection Act depth zones
    and slope classes they belong: Depth Zone 2 (intertidal to 30 m), Depth Zone 3 (30
    to 100 m), and Slope Class 1 (0 degrees - 5 degrees). Depth Zones 1 (intertidal)
    and 4 to 5 (greater than 100 m), as well as Slopes Classes 2 to 4 (greater than
    5 degrees), are not present in this map area. The map is created using a supervised
    classification method described by Cochrane (2008), available at http://doc.nprb.org/web/research/research%20pubs/615_habitat_mapping_workshop/Individual%20Chapters%20High-Res/Ch13%20Cochrane.pdf.
    References Cited: California Department of Fish and Game, 2008, California Marine
    Life Protection Act master plan for marine protected areas--Revised draft: California
    Department of Fish and Game, accessed April 5 2011, at http://www.dfg.ca.gov/mlpa/masterplan.asp.
    Cochrane, G.R., 2008, Video-supervised classification of sonar data for mapping
    seafloor habitat, in Reynolds, J.R., and Greene, H.G., eds., Marine habitat mapping
    technology for Alaska: Fairbanks, University of Alaska, Alaska Sea Grant College
    Program, p. 185-194, accessed April 5, 2011, at http://doc.nprb.org/web/research/research%20pubs/615_habitat_mapping_workshop/Individual%20Chapters%20High-Res/Ch13%20Cochrane.pdf.
    Sappington, J.M., Longshore, K.M., and Thompson, D.B., 2007, Quantifying landscape
    ruggedness for animal habitat analysis--A case study using bighorn sheep in the
    Mojave Desert: Journal of Wildlife Management, v. 71, p. 1419-1426.",nt"license_title":
